let container = {
  width: "69.9%",
  height: "99.1%",
  margin: "10px 0 10px 10px"
}

let searchInput = {
  width: "99.8%",
  height: "30px",
  outlineWidth: "0px",
  boxSizing: "border-box",
  fontSize: "17px",
  marginBottom: "10px",
  backgroundColor: "#e4f7ff",
}

// let listContainer = {
//   minWidth: "100%",
//   height: "95%",
// }

let listItemContainer = {
  display: "flex",
  height: "22px",
  width: "99.8%",
  marginBottom: "3px",
  borderRadius: "5px 5px 5px 5px",
  backgroundColor: "#e4f7ff",
  cursor: "pointer",
}

let listItemDataMain = {
  fontSize: "15px",
  textAlign: "center",
  minWidth: "200px",
  color: "white",
  backgroundColor: "#063b50",
  overflow: "hidden",
  whiteSpace: "nowrap",
  lineHeight: "22px",
  borderRadius: "4px 0px 0px 4px",
}

let listItemDataOther = {
  fontSize: "15px",
  textAlign: "center",
  width: "16.67%",
  textTransform: "capitalize",
  overflow: "hidden",
  whiteSpace: "nowrap",
  textOverflow: "ellipsis",
  lineHeight: "20px",
}

let listContainer = {
  display: "flex",
  width: "100%",
  fontWeight: "bold",
  marginTop: "20px"
}

let listMain = {
  fontSize: "17px",
  minWidth: "200px",
  height: "25px",
  textAlign: "center",
  fontWeight: "bold",
  textTransform: "capitalize",
  color: "white"
}

let listOther = {
  display: "flex",
  width: "100%",
  marginLeft: "12px",
  color: "white"
}

let indexStyle = {
  minWidth: "16.67%",
  textAlign: "center"
}

export {
  container,
  searchInput,
  // listContainer,
  listItemContainer,
  listItemDataMain,
  listItemDataOther,
  listContainer,
  listMain,
  listOther,
  indexStyle
}
